import React, { useState, Modal } from "react";

export function CreateSimulationButton(props) {

    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return (
        <>
            <button className="bg-blue-300 rounded-full py-3 px-6 font-bold mt-1" onClick="{handleShow}">Create Simulation +</button>

            <Modal show="{show}" onHide="{handleClose}">
                <Modal.Header closeButton>
                    <Modal.Title>
                        <Title>Create Simulation</Title>
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    This is where the content of the form will go
                </Modal.Body>
                <Modal.Footer>
                    <Button className="bg-green-500 rounded-full py-3 px-6 font-bold">Create</Button>
                    <Button className="bg-red-500 rounded-full py-3 px-6 font-bold">Cancel</Button>
                </Modal.Footer>
            </Modal>
        </>
    );
}
